import React from 'react'
import { View, Text } from 'react-native'
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import ProfileScreen from './screens/ProfileScreen';
import SignUpScreen from './screens/SignUpScreen';
import { Ionicons } from "@expo/vector-icons";
import { AntDesign } from '@expo/vector-icons';

interface Props {
  user: string;
}

export default function Tab(user: Props) {

  console.log(user)

  const Tab = createBottomTabNavigator();

  return (
    <Tab.Navigator
     screenOptions={{
      headerShown: false,
      tabBarShowLabel: false,
      tabBarStyle: {
        height: 60,
        bottom: 20,
        position: 'absolute',
        left:20,
        right: 20,
        elevation:0,
        borderRadius: 20,
        backgroundColor: '#e1c4ff',
      }
     }}
    >
      {/* <Tab.Screen name="Login" component={SignUpScreen} options={{
        tabBarIcon: ({focused}) => (
          <View>
            <AntDesign name="profile" size={30} color={focused ? "rgb(20,20,30)" : "#8e8e93"} />
          </View>
        )
      }}/> */}
      <Tab.Screen name="Profile" user={user} component={ProfileScreen} options={{
        tabBarIcon: ({focused}) => (
          <View>
            <Ionicons name="md-person-circle-outline" size={35} color={focused ? "rgb(20,20,30)" : "#8e8e93"} />
          </View>
        )
      }}/>
    </Tab.Navigator>
  );
}
